import React from "react";
import { FaStar } from "react-icons/fa";

const Rating = ({ rating }) => {
  const totalRating = [];

  for (let i = 0; i < 5; i++) {
    if (i < rating) {
      totalRating.push(
        <li className="star" key={i}>
          <FaStar />
        </li>
      );
    } else {
      totalRating.push(
        <li className="star-o" key={1}>
          <FaStar />
        </li>
      );
    }

    return <div className="rating"></div>;
  }
};

export default Rating;
